art prints, enamel pins and accessories ','5 x 2 metre £550 +VAT'),(1712,'Catherine','Dodds','catherine.dodds@bristol.ac.uk','0117 456 0299','think.ink.bristol','Think Ink Bristol','We collaborate with tattoo artists to ensure tattoo practices are more safe and inclusive for everyone living with blood borne viruses.','2 x 2 metre £250 +VAT'),(1791,'Jessica ','Stephens ','hellonshirts@gmail.com','07983546410','Hellonshirts','Hell on Shirts ','Officially licensed horror movie merchandise and skateboard decks ','4 x 2 metre £450 +VAT'),(1811,'Billy','Adams','plurple.shop@hotmail.com','07377057088','www.plurple.shop','plurple','plurple sell giant clack fans. funny trucker hats. silly socks. trippy pillows.  all designed by us.  please check us out www.plurple.shop.  this is our first year trading and are really excited about getting out there.','3 x 2 metre £350 +VAT'),(1835,'Nat','Delaney','nat@wbj.team','07545921553','Tish_lyon & wholesalebodyjewellery & wbjtattoo ','Body jewellery ltd','We sell body jewellery, piercing and tattoo supplies. We would love to sponsor the show and have a 10m stand of available. \r\n\r\nWe have been in the industry for over 20 years and go to many conventions a year including the likes Brighton, London, Telford and many others. ','6 x 2 metre £650 +VAT'),(1836,'Victoria ','Rigden-Murphy','cursedrosejewellery@gmail.com','07976582893','CURSED.ROSE.JEWELLERY','Cursed Rose Jewellery ','We are a Queer Positive,  Sex Positive,  Glitter Positive small jewellery business, specialising in resin and upcycled items. As a brand we focus on the alt market providing sweary/adult jewellery and retro kitch earrings.','2 x 2 metre £250 +VAT'),(1841,'Hayley','Owen','shadowcandlesuk@gmail.com','07817510060','Shadowcandles.uk','Shadow Candles','Soy wax candles, wax melts and Reed diffusers ','2 x 2 metre £250 +VAT'),(1845,'Daniel','Leonard','dan@zapplaserstudio.co.uk','07812352336','https://www.instagram.com/zapp_laser_studio/','Zapp Laser Studio Bristol Ltd','We offer the fastest, safest and most effective laser tattoo removal with the world renowned PicoSure Laser. We have been established as a business for over eight years and have been practicing in Bristol for four. We work closely with and have build strong relationships with many tattoo artists in and around Bristol who refer clients to us for full removal or fading to cover existing tattoos. We would LOVE to be a part of the convention next year and look forward to hearing from you again soon. Best wishes, Dan.','4 x 2 metre £450 +VAT'),(1849,'Christopher','Evans','christopherevans@charitylink.net','01189241374','N/A','Charity Link obo Dogs Trust','Dogs Trust is the UKs largest dog welfare charity. We care for around 14,000 lost and abandoned dogs each year.','2 x 2 metre £250 +VAT'),(1908,'Sabina','Palermo','hi@hicacti.com','7354862939','Hi_Cacti','Hi Cacti','Desert Inspired Southwestern textiles and decor','2 x 2 metre £250 +VAT'),(1912,'Zahra','Davies','zahrazuzzana@gmail.com','07873112281','https://www.instagram.com/z.u.u.z.k.i/','ZUUZKI','Zuuzki evokes a sense of play by creating a platform for people to express themselves in all inclusive and unisex clothing collections. To give people a chance to say things through their garments that they may not be able to in other ways. Timeless design and unique aesthetic within Zuuzkis collections, fusing inspiration from Ancient cultures and Traditional tattooing to create an intrigue for the bazaar.  \r\n\r\nZuuzki is part of the change the world needs to see by being a slow fashion clothing company that produces collections that are eco-friendly, upcycled and sustainable. To be environmentally conscious Zuuzki reduces waste and uses products sourced from an EarthPositive clothing range, their manufacturing facilities are powered by green renewable energy, from low-impact raw materials which has resulted in a 90% reduced carbon footprint. ','2 x 2 metre £250 +VAT'),(1949,'Sukhdeep','Najafi ','sukhdeep@hennabristol.com','07761034848','https://www.instagram.com/holistic.henna/?hl=en','Holistic Henna ','Organic freehand henna tattoo artistry','2 x 2 metre £250 +VAT'),(1972,'Claire','Cashman','kasasagi.jewellery@gmail.com','07974319244','Kasasagi.jewellery','Kasasagi Jewellery','Bristol based jeweller inspired by the natural world the macabre , unusual and occasionally geeky. Created using recycled precious metals and ethically sourced gems, stones and bones. ','2 x 2 metre £250 +VAT'),(2000,'Jake ','Evans','info@jaegrills.co.uk','07464627488','@jaegrills','JaeGrills LTD','Based in Brighton U.K. JaeGrills continues to push boundaries of dental art, creating unique custom grillz.\r\nJaeGrills provides high quality one-of-one crafted pieces that are uniquely and exclusively tailored to you.\r\n','4 x 2 metre £450 +VAT'),(2199,'Matt','Startin','info@klatch.co','07930641094','https://www.instagram.com/klatchco/','Klatch Co','Accessories brand for the skateboard community. Using the brand to build a community and create conversations around Men\'s Mental Health within the skateboarding, music and tattoo community. We donate 10% of our profits to Movember Charity.','3 x 2 metre £350 +VAT'),(2229,'GEORGIE','TAYLOR-DAVIES','georgie@viciouspunx.com','07718621207','@vicious_punx','VICIOUS PUNX','WE ARE A GENDERLESS JEWELLERY BRAND MERGING STREETWEAR AND PUNK TOGETHER TO CREATE BOLD APPAREL. WE ARE SIZE INCLUSIVE AND LOVE TO CREATE JEWELLERY FOR THE MISFITS OF THE WORLD. WE ARE PASSIONATE ABOUT CREATING ACCESSORIES FOR EVERYONE AND BEING AFFORDABLE TOO!','4 x 2 metre £450 +VAT'),(2234,'Catherine','Stevenson','catherine@pinsandknucklesmerch.com','+44-20-80899104','https://www.instagram.com/pinstattooclub/','Pins Tattoo Club','Pins Tattoo Club is a division of Pins & Knuckles Merch that focuses on providing merch printing & branding services to those in the tattoo & alternative arts scene in the UK & Europe. Our priority is to build, uplift and strengthen a sense of community within the scene while providing high quality, personalized service to tattooists looking to expand their income through merch sales.\r\n\r\n','3 x 2 metre £350 +VAT'),(2344,'Jamie','Bayfield ','contact@fouljewellery.com','07504195116 ','@fouljewellery','Foul Jewellery ','Hello. At foul jewellery I create custom jewellery as well as offer a catalogue of peices. My work ranges from rings bracelets and necklaces to more bespoke items such as grillz, 4 finger rings, nose chains. I have a background in quality and manufacturing engineering. This is reflected in my jewellery as I only use high quality precious materials and am very meticulous about quality and design. I often collaborate with other artists including tattoo artists and am always on the look out for ambitious projects. ','2 x 2 metre £250 +VAT'),(2373,'Dan','Thrippleton','danthrippleton@gmail.com','07917163552','@neonblack2020','Neonblack ','Handmade clay wall hangings with tattoo and religious iconography as influence and custom denim jackets','2 x 2 metre £250 +VAT'),(2385,'Sally','Kelland','demonkittyshop@gmail.com','07539824741','www.instagram.com/demonkittyshop','Demonkitty','I handmake Gothic, Victorian Gothic and Art Nouveau style jewellery, accessories, and headdresses, as well as skull bone and insect jewellery, domes and wall art. I have moved to the UK from Australia where I have been doing pop culture cons, medieval fairs, Gothic and Steampunk fairs etc for 12 years. My brand became very popular and I wanted to bring it to a larger demographic, as well as widen my travel horizons. I use sterling silver, rhodium, brass, stainless steel, gemstones, Czech glass and real bones and insects, sustainably sourced. Quality and customer satisfaction is absolutely crucial to my ethos and I have had much repeat custom over the years. I attended your tattoo convention in 2023 as a visitor and believe my brand would suit your show. My pieces are also quite different to any that were at that show.','3 x 2 metre £350 +VAT'),(2406,'Adam','Elms','nona.contact@gmail.com','07412593573','https://instagram.com/nonaGalleryArt','Nona Gallery','I would plan on creating exclusive products launched and only available at your event of limited edition t-shirt designs, and other apparel themed on tattoo culture. The majority of my products are designed primarily to be sentimental and meaningful gifts. Such as my range of Talismans, which aim to give a bit of extra magic and encouragement. This is to continue my aim of having very unique items for the customer. The entire range was also nominated for last year\'s A Design awards for best new product design. My most popular product is my meme-inspired clothing range, which is unisex and nominated for 2024\'s Small Business Sustainable Product Award, as each garment is handmade by myself, 100% organic and completely fairtrade and vegan certified. My other products include handmade jewellery, keyrings, sticker sheets, and books illustrated and written by myself, and that would be able to be personally signed on the day of purchase. Everything I sell is completely original designs featuring original characters, this is to continue our aim of having very unique and never-before-seen items, with extra personalised and sentimental meaning for the customer. All my products encourage diversity and inclusion, as well as spreading awareness of different cultures and lifestyles. I also donate product sale profits yearly to the UK-based charity the Human Dignity Trust which continually fights for the human and legal rights of LGBQT+ people around the world.','4 x 2 metre £450 +VAT'),(2412,'Alex','Ibsule','mrs.godmachine@gmail.com','07858-709248','@godmachine ','Godmachine ','Art & Apparel by the UK artist Godmachine','6 x 2 metre £650 +VAT'),(2495,'Mickey','Ashton','mail@mickeyashton.com','07870168033','@mickey_ashton_tarot','Mickey Ashton Tarot Card Reader','I read Tarot Cards at Tattoo conventions and motorcycle events ','2 x 2 metre £250 +VAT'),(2530,'Pete','Marshall','pete@sullenclothing.co.uk','07595373322','Sullenclothinguk','Sullen Clothing','Tattoo clothing brand','3 x 2 metre £350 +VAT'),(2550,'Lana','Sophia','lana@crystal-canine.co.uk','07985522545','@crystalcanine','Crystal Canine','The UK\'s OG tooth gem company','4 x 2 metre £450 +VAT'),(2586,'Callum','Dee','callum@thebaldviking.co.uk','07557655846','@thebaldvikingbeardcompany','The Bald Viking Beard Company','I run The Bald Viking Beard Company and make beard products, tattoo aftercare, beard soaps and other cosmetics. i also sell brushes, combs, beanies, caps and other merchandise that is norse inspired. Some tattoo conventions don\'t want me selling my aftercare there as their sponsors may be doing so already, if this is the case then I\'m happy to sell everything else except that.','2 x 2 metre £250 +VAT'),(2594,'Alison','Morgan-Clark','amorganclark@gmail.com','07577779853','https://www.facebook.com/SilverAliJeweller/','SilverAli','Handmade sterling silver jewellery','2 x 2 metre £250 +VAT'),(2595,'Jodie ','Phillips ','nudejewels.jewellery@gmail.com','07462389078','@nude_jewels ','Nude Jewels ','I am a self taught silversmith, I hand make sterling silver jewellery with opals and other gemstones. I mainly make rings, necklaces and wrist wear. ','2 x 2 metre £250 +VAT'),(2596,'Sophie','Talbot','twistedsquidts@outlook.com','07860735236','www.instagram.com/twistedsquidts','Twisted Squid','Im an artist, creating my designs with inspiration from mental health struggles, chronic illnesses, body art, myths, legends, and deep sea creatures. I try to use my work as a way to help people struggling with the same issues as me, feel less alone, whilst looking cool ;)\r\n\r\nI sell clothing (t shirts, hoodies, beanies and soon, shorts) adult colouring books, art prints, and small accessories ','5 x 2 metre £550 +VAT'),(2600,'Gemma','Philip ','lifeofpyrography@gmail.com','07447927358','@lifeofpyrography','Life of Pyrography ','A one stop goth shop with all handmade items from taxidermy pieces to fabric plushies, bags and purses, wooden items burned and Lasered and resin items handcrafted all by us.','2 x 2 metre £250 +VAT'),(2618,'Hazel','Potter','hazelhextarot@gmail.com','07931095396','Hex_tarot','Hex tarot','Tarot reader','2 x 2 metre £250 +VAT'),(2628,'Edward ','Waldron','ned@nedzrotary.com','07706347735','Nedzrotary','Nedz Rotary','Nedz tattoo machines ','2 x 2 metre £250 +VAT'),(2649,'Phil','Wall','info@neverstaydead.co.uk','07584484352','@neverstaydead','Never Stay Dead','We are known for offensive, but cute designs and have a range of products including colouring books, T-shirts, beanies, greeting cards, artwork, and much more. Our social media pages have a combined audience of around half a million followers.','4 x 2 metre £450 +VAT'),(2662,'Myriam','Tillson','myriam.tillson@gmail.com','07527120875','@myriamtillson','Myriam Tillson','I am a traditional surreal artist who works both in colour and black and white. My work is dark, dream-like and sometimes even absurd.','2 x 2 metre £250 +VAT'),(2703,'Lee','Preston','lee.preston@vapeandjuice.com','07771366591','Vapelocouk','Vape & juice south west Ltd trading as Vape Loco ','We are a uk made nicotine salt brand that focus on converting people from single use disposable vapes. ','2 x 2 metre £250 +VAT'),(2706,'anett','fritsch','anettxf@gmail.com','004917675879843','https://www.instagram.com/crack_your_bones?igsh=MWt4eWloeG1kaGY1dw%3D%3D&utm_source=qr','crack your bones','bodyempowerment, chiropractics, nerve acupressure and muscle mobilisation, cupping and massages especially for crooked tattooer backs, arms and hands! i already worked at the kaiserstadt tattoo convention and had to close my bookings, the artists liked it very much and some of them came back for a treatment every day :) i would love to work at your convention!!','3 x 2 metre £350 +VAT'),(2790,'Samantha','Coombes','devilcakecreations@gmail.com','07724678225','https://www.instagram.com/devilcakecreations','Devil Cake','Devil Cake strives to combine luxurious feel with ethical clothing, created to empower anyone that slips our designs on. From its logo to every design named after a breed of kitten,\r\nDevil Cake has been made for and inspired by YOU <3\r\nThe brand prides itself on ethical values. From the sourcing of natural bamboo and cotton\r\nfabrics and minimizing waste, to ensuring all workers have equal opportunity and comfortable\r\nliving at our production house in Goa, India. We ensure all our dresses, skirts, tops and leggings\r\nare made to measure and feel amazing to wear, making you feel ready to take on anything.\r\nDevil Cake will also showcase clothing by our production house and brand Butcher Apparel,\r\nwho specialize in unique high quality apocalyptic wear.\r\n\r\nWe were a hit at the Tattoo Tea Party in Manchester, the Big North Tattoo Show in Newcastle, and the Big London Tattoo show. So we believe we will be a wonderful addition to Bristol Tattoo Convention.\r\n\r\nCheck out the website here: www.devilcake.co.uk.\r\n','3 x 2 metre £350 +VAT'),(2887,'Andres','Rodriguez','andres@rufner.es','+34 625467303','@aloetattoo @versuscartridge ','Aloetattoo and Versus ','Cosmetics for tattoo artists and cartridges ','4 x 2 metre £450 +VAT');
