terms shall be subject to the exclusive jurisdiction of the courts of England and Wales..</p>\n<h3>Updates and Modifications</h3>\n<p>We reserve the right to modify or update the terms at our discretion, and such changes will become effective upon posting.<br /></p>\n<h3>Contact Information</h3>\n<p>If you have any questions, concerns, or inquiries regarding these terms, please feel free to contact us at <a target=\"_blank\" href=\"mailto:info@bristoltattooconvention.com\" rel=\"noreferrer noopener\">info@bristoltattooconvention.com</a>. We value your feedback and are here to assist you.</p>\n<h3>Cookies and Tracking</h3>\n<p>We respect your privacy so the only cookies we use are related to our CMS. We are using <a target=\"_blank\" href=\"https://withcabin.com/\" rel=\"noreferrer noopener\">Cabin Analytics</a> to track user movements to better optimise our website.</p>\n<h3>Third-Party Links</h3>\n<p>Our website may contain links to third-party websites for informational or convenience purposes.</p>\n<p>However, we do not endorse or control the content on these external sites, and we disclaim any responsibility for the accuracy, legality, or appropriateness of such content.</p>\n<p>Users should exercise caution and review the terms and privacy policies of any linked websites before engaging with them.<br /></p>\n<h3>Indemnification</h3>\n<p>By using the website, users agree to indemnify Bristol Tattoo Convention and hold us harmless from any legal claims, liabilities, or expenses that may arise due to their actions or content on the platform.</p>\n<p></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15,195,1,'2023-10-26 21:21:35','2023-10-26 21:21:35','a38aef7b-4163-4a08-a1bf-8ffda1029408','<p>Full terms and conditions of use of this website to go here. Will be generated with ChatGPT or something.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(16,197,1,'2023-10-26 21:21:39','2023-10-26 21:21:39','a3b2ca10-250f-499f-85eb-cb1268354504',NUL