ts to ensure they are aged over 18.</li><li>Hand out consent forms to all clients before getting tattooed.</li><li>Provide all clients with aftercare instructions and advice.</li><li>Wash hands using the dedicated artist hand wash stations.</li><li>Wear disposable gloves and change frequently throughout procedures.</li><li>Keep all work areas clean and tidy at all times, covering all work surfaces to prevent any cross contamination.</li><li>Clean the workstation between each client.</li><li>Dispose of needles and hazardous waste in containers and bags provided.</li><li>Only use single use and disposable equipment.</li><li>We do not provide any sterilisation facilities.</li><li>Bring with you clearly marked and labelled sanitising products, any diluted solutions must be measured to manufacturers instructions.</li><li>If travelling from abroad please inform us of any products you may require.</li></ul>\n<p>The booth includes:</p><ul><li>2 power sockets per artist.</li><li>Artist work table.</li><li>Front display table.</li><li>Hazardous waste bag.</li><li>Sharps container.</li><li>General waste bag.</li><li>Bottled water, cups and kitchen roll.</li><li>Reprographics and transfer services are provided free of charge.</li></ul>\n<p>Trade supplies will be on sale at the convention via suppliers.</p>\n<p>All booths are enclosed shell scheme with lighting and fascia board.</p>\n<p>Booths are 2m x 2m with 30cm x 2m fascia board.</p>\n<p>Booth fee is £420 inc. VAT per artist.</p>\n<p>Fee includes one additional helper pass.</p>\n<p>Fee includes all licence and registration fees related to Bristol City Council.</p>\n<p>BOOTH SPACE IS ONLY GUARANTEED UPON FULL PAYMENT AND IS NON TRANSFERABLE.</p>\n<p>Please click the following link for Bristol City Council Tattoo Byelaws.<br /><a href=\"https://www.bristol.gov.uk/files/documents/1755-byelaws/file\">https://www.bristol.gov.uk/fil...</a></p>\n<h2>Trader terms</h2>\n<p>Trader terms here.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NU