 our website or submit content, we may collect the following types of personal data:</p>\n<ul><li>Name</li><li>Email Address</li><li>Cookies and Usage Data</li><li>Newsletter Signup Consent</li></ul>\n<h4>Data Collection Methods</h4>\n<p>We collect user data through the following methods:</p>\n<ul><li>Information you provide through forms on our website:<ul><li>newsletter signup</li><li>new tool submission form</li></ul></li><li>Anonymous usage analytics with <a target=\"_blank\" href=\"https://withcabin.com/\" rel=\"noreferrer noopener\">Cabin</a>.</li></ul>\n<h4>Purpose of Data Collection</h4>\n<p>We collect and process your personal data for the following purposes:</p>\n<ul><li>To enable content submissions and publish user-generated content on our website.</li><li>To respond to inquiries, feedback, or requests you submit to us.</li><li>To improve the functionality and user experience of our website.</li><li>To send you marketing communications, subject to your consent where required by law.</li></ul>\n<h4>Legal Basis</h4>\n<p>We process your personal data based on the following legal grounds:</p>\n<ul><li>With your consent, which you can withdraw at any time.</li><li>To fulfill our contractual obligations to you (e.g., processing content submissions).</li><li>For our legitimate interests in operating and improving our website.</li></ul>\n<h4>Use of Collected Data</h4>\n<p>We use the collected data for the following purposes:</p>\n<ul><li>To review and publish user-submitted content on our website.</li><li>To communicate with you regarding your content submissions or inquiries.</li><li>To analyse website usage and improve our services.</li><li>To send you marketing communications, provided you have given your consent.</li></ul>\n<h4>Data Sharing</h4>\n<p>We may share your personal data with third parties in the following circumstances:</p>\n<ul><li>With service providers who assist us in operating the website and providing our services. (<a target=\"_blank\" href=\"https://sanity.io/\" rel=\"noreferrer noopener\">Sanity.io</a> for our content management and <a target=\"_blank\" href=\"https://www.brevo.com/\" rel=\"noreferrer noopener\">Brevo</a> for our email marketing)</li><li>To comply with legal obligations or respond to lawful requests from government authorities.</li></ul>\n<h4>User Rights</h4>\n<p>You have the following rights concerning your personal data:</p>\n<ul><li>The right to access and obtain a copy of your personal data.</li><li>The right to rectify any inaccurate or incomplete personal data.</li><li>The right to erase your personal data under certain conditions.</li><li>The right to restrict the processing of your personal data.</li><li>The right to object to the processing of your personal data.</li><li>The right to withdraw consent for marketing communications.</li></ul>\n<h4>Data Retention</h4>\n<p>We will retain your personal data for as long as necessary to fulfill the purposes outlined in this Privacy Policy unless a longer retention period is required or permitted by law.</p>\n<h4>Security Measures</h4>\n<p>We implement appropriate technical and organizational measures to protect your personal data from unauthorized access or disclosure.</p>\n<h4>Third-Party Links</h4>\n<p>Our website may contain links to third-party websites. We are not responsible for the privacy practices or content of such websites.</p>\n<h4>Children\'s Privacy</h4>\n<p>Bristol Tattoo Convention does not knowingly collect personal data from individuals under the age of 16. If you are a parent or guardian and believe your child has provided us with personal data, please contact us immediately.</p>\n<h4>Cookies</h4>\n<p>We are using Cabin to track usage on the website, which uses no Cookies to maintain your privacy. We gather no personal data that can link you to the usage data we collect. Read more about the <a target=\"_blank\" href=\"https://withcabin.com/privacy/augmentools.vercel.app\" rel=\"noreferrer noopener\">Cabin policies</a>.</p>\n<h4>Updates to the Privacy Policy</h4>\n<p>We may update this Privacy Policy from time to time to reflect changes in our practices or for other operational, legal, or regulatory reasons. The date of the last update will be indicated at the beginning of the policy.</p>\n<h4>Contact Information</h4>\n<p>If you have any questions or concerns about this Privacy Policy or our data practices, please contact us at: <a target=\"_blank\" href=\"mailto:info@bristoltattooconvention.com\" rel=\"noreferrer noopener\">info@bristoltattooconvention.com</a> or reach out to us on <a target=\"_blank\" href=\"https://instagram.com/bristoltattooconvention\" rel=\"noreferrer noopener\">Instagram</a>.</p>\n<p></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(51,2150,1,'2023-12-04 02:56:33','2023-12-04 02:56:33','ce02c380-3bc5-4430-895d-466c1f1675ef','<p><br /></p>\n<h2>Artist terms</h2>\n<p>I agree on behalf of the artist and studio named, to release Bristol Tattoo Convention Ltd. and its employees and agents from all manner of claims, actions and demands in law arising from the procedure of tattooing, damages, accidents or thefts in the work area.</p>\n<p>Please check that you are covered by suitable insurance to work the event.</p>\n<p>If travelling from overseas please ensure you have in place all relevant documentation to support your visit.</p>\n<p>I agree to provide current valid copies of personal and studio licences as requested.</p>\n<p>I understand that upon signature I am entering into an agreement with Bristol Tattoo Convention Ltd. and the venue.</p>\n<p>I agree to follow the safety and hygiene procedures outlined below whilst working at Bristol Tattoo Convention:</p>\n<ul><li>ID clients to ensure they are aged over 18.</li><li>Hand out consent forms to all clients before getting tattooed.</li><li>Provide all clients with aftercare instructions and advice.</li><li>Wash hands using the dedicated artist hand wash stations.</li><li>Wear disposable gloves and change frequently throughout procedures.</li><li>Keep all work areas clean and tidy at all times, covering all work surfaces to prevent any cross contamination.</li><li>Clean the workstation between each client.</li><li>Dispose of needles and hazardous waste in containers and bags provided.</li><li>Only use single use and disposable equipment.</li><li>We do not provide any sterilisation facilities.</li><li>Bring with you clearly marked and labelled sanitising products, any diluted solutions must be measured to manufacturers instructions.</li><li>If travelling from abroad please inform us of any products you may require.</li></ul>\n<p>The booth includes:</p>\n<ul><li>2 power sockets per artist.</li><li>Artist work table.</li><li>Front display table.</li><li>Hazardous waste bag.</li><li>Sharps container.</li><li>General waste bag.</li><li>Bottled water, cups and kitchen roll.</li><li>Reprographics and transfer services are provided free of charge.</li></ul>\n<p>Trade supplies will be on sale at the convention via suppliers.</p>\n<p>All booths are enclosed shell scheme with lighting and fascia board.</p>\n<p>Booths are 2m x 2m with 30cm x 2m fascia board.</p>\n<p>Booth fee is £420 inc. VAT per artist.</p>\n<p>Fee includes one additional helper pass.</p>\n<p>Fee includes all licence and registration fees related to Bristol City Council.</p>\n<p>BOOTH SPACE IS ONLY GUARANTEED UPON FULL PAYMENT AND IS NON TRANSFERABLE.</p>\n<p>Please click the following link for Bristol City Council Tattoo Byelaws.<br /><a href=\"https://www.bristol.gov.uk/files/documents/1755-byelaws/file\">https://www.bristol.gov.uk/fil...</a></p>\n<h2>Trader terms</h2>\n<p>You agree to keep booth area clean and tidy and to work within the boundaries of the booth.</p>\n<p>Trade booths are not to be used for Tattooing, </p>\n<p>You agree to not sell any alcohol or offensive weapons.</p>\n<p>Trade Booths are fully enclosed shell scheme with fascia board.</p>\n<p>All booths will have a minimum of 2 power sockets.<br /></p>\n<p>You will receive 2 working passes for the weekend.</p>\n<p>Booths sizes available are :</p>\n<p>2x2 metre</p>\n<p>3x3 metre</p>\n<p>4x2 metre</p>\n<p>5x2 metre</p>\n<p>6x2 metre</p>\n<p></p>\n<p>Your space at the show is not guaranteed until full payment is received.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(52,2913,1,'2024-02-14 13:25:00','2024-02-14 13:25:02','e10f6945-9de1-4011-a385-9c893df3ff8a','<p>Full artist listing coming January 2024.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(53,2914,1,'2024-02-14 13:25:01','2024-02-14 13:25:01','4e27e2d7-27f8-4fd1-ba72-6e818f15a4f2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(54,2915,1,'2024-02-14 13:25:02','2024-02-14 13:25:02','8244b7b5-3b6a-40d6-a3b8-e6ec494abdd1',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(55,2916,1,'2024-02-14 13:25:04','2024-02-14 13:25:04','668d56e2-2ae0-4db7-a459-986bf73e38ec',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(57,2918,1,'2024-02-14 13:25:17','2024-02-14 13:25:17','c97154b6-fbc4-4816-bf3f-ebc626955c9c',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(58,2920,1,'2024-02-14 13:25:17','2024-02-14 13:25:17','73b5d17c-4cbf-4f13-9e76-fb1ad37cd51e',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(59,2971,1,'2024-02-16 10:01:42','2024-02-16 10:01:42','7840bae3-629d-46ff-b102-1ad6485f164c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(60,2972,1,'2024-02-16 10:01:45','2024-02-16 10:01:45','513804d4-a50a-4024-8de3-08e80f823932','<p>We are thrilled to announce that the next Bristol Tattoo Convention</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(61,2973,1,'2024-02-16 10:02:07','2024-02-16 10:02:07','d6ab88b1-ee56-4094-9a6a-57bbf2128204','<p>We are thrilled to announce that the next Bristol Tattoo Convention will be hosted</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(62,2974,1,'2024-02-16 10:02:22','2024-02-16 10:02:22','b